import styled from 'styled-components';
import {Link} from 'react-router-dom';

export const Nav = styled.div`
    height: 60px;
    display: flex;
    justify-content: space-between;
    padding: 1rem 2rem;
    z-index: 100;
    position: fixed;
    width: 100%;
    background: #000;
`;

export const NavLink = css`
    color: #fff;
    display: flex;
    align-items: center;
    padding: 0 1rem;
    height: 100%;
    cursor: pointer;
`;

export const Logo = styled(Link)`
    color: #fff;
    text-decoration: none;
    font-style: italic;
`;

